define({"topics" : [{"title":"Schema and Table Name Patterns","shortdesc":"\n                  <p class=\"shortdesc\">You define the group of tables that the SQL Server 2019 BDC Multitable Consumer         origin reads by defining schema and\n                     table name patterns for the table configuration. The         origin reads all tables with names that match the table pattern\n                     in the schemas with names         that match the schema pattern. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/SQLServerBDCMultitable.html#SQLServerBDCMultitable-TableConfig_Patterns","attributes": {"data-id":"SQLServerBDCMultitable-TableConfig_Patterns",},"menu": {"hasChildren":false,},"tocID":"SQLServerBDCMultitable-TableConfig_Patterns-d46e88770","topics":[]},{"title":"Offset Column and Value","shortdesc":"\n                  <p class=\"shortdesc\">The SQL Server 2019 BDC Multitable Consumer origin uses an offset column and initial         offset value to determine where\n                     to start reading data within tables and         partitions.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/SQLServerBDCMultitable.html#SQLServerBDCMultitable-TableConfig_Offset","attributes": {"data-id":"SQLServerBDCMultitable-TableConfig_Offset",},"menu": {"hasChildren":false,},"tocID":"SQLServerBDCMultitable-TableConfig_Offset-d46e88856","topics":[]},{"title":"Reading from Views","shortdesc":"\n                  <p class=\"shortdesc\">The SQL Server 2019 BDC Multitable Consumer origin can read from views in addition to         tables. </p>\n               ","href":"datacollector\/UserGuide\/Origins\/SQLServerBDCMultitable.html#SQLServerBDCMultitable-TableConfig_Views","attributes": {"data-id":"SQLServerBDCMultitable-TableConfig_Views",},"menu": {"hasChildren":false,},"tocID":"SQLServerBDCMultitable-TableConfig_Views-d46e88952","topics":[]}]});